Genre: Horror 

Synopsis: The protagonist of this film is a deeply troubled individual; a well-rounded character as a bad guy for a change. No hockey masks or knife gloves on display here - just a man with fire.

Fire holds a dual role of master and servant, giving an interesting, intellectual slant to the central character. He fears fire, and yet he controls it... [Less] 

